@rekodi_i @TheMindOfSlyme @opensea There's nothing wrong with making it clear which projects are doxxed and which are not. It's just info.

"The whole point of crypto" is to empower people, and some people want to know who is behind their investments.

If you don't like it, use another market. Plenty of choices.

@MetaverseMarket @cryptostacys @NFTs_girl @crypto_karens Hey quick feedback - this new timeline is very difficult to follow compared to the v2. Everything squished at the top.

Twitter doesn't make it easy to open images and resize them.

It is also impossible to see traits of each project - such as does it have a real female artist?

@_LegendPhoenix @cryptostacys @NFTs_girl IMHO this is the worst aspect of the NFT space.

People are so attached to "value of purchase" they can't have a civil discussion about key issues, even with legitimate concerns.

Here's the thing though, if the community won't be real and improve, they will never really soar.

@cryptostacys @NFTs_girl I've seen some information on this around, although it is hard to tell how accurate it us. 

There's a new version of this one below, but the updated graphic is really difficult to read. This information really needs a curated website.

https://t.co/n1ust6oMP2

@thechek182 @CptSpesh @fivestarnfts @MsPolly11 @NFTCryptoChicks It's possible. The team has grown since then.

These have been around and publicly visible for months before this was noticed.

I doubt the devs and marketing folks for *any* NFT collections are doing a deep dive into the art. Perhaps this should change.

@CryptoAnto Plenty of discords out there for people to learn in.

Too many trash conversations, FUD, bots, and scam links. Hacks too. 

Projects that put their REAL communities first have everything to gain and nothing to lose.
